 4. DA INSCRICAO
 4.1 As inscricoes deverao ser efetuadas no periodo de 19 de setembro de 2014 a 19 de outubro 
de 2014, por meio de preenchimento de formulario de inscricao disponivel para download no 
Grupo nominado 2o INOVASUS-DF, existente na plataforma de comunicacao nominada REDE 
SAUDE DF, acessivel pelo sitio http://rede.saude.df.gov.br.
 4.1.1 O formulario de inscricao devera ser devidamente preenchido e compartilhado com o 
perfil nominado 2o INOVASUS-DF.
 5. DOS REQUISITOS E PROCEDIMENTOS PARA INSCRICAO:
 5.1. A iniciativa inscrita podera estar em vigencia e/ou ter sido testada ate a data da inscricao; 
obrigatoriamente devera estar inserida nas areas tematicas constantes no item 2 deste edital; 
demonstrar aplicabilidade em outros servicos, sustentabilidade, inovacao e impacto potencial; 
apresentar resultados das acoes implantadas/implementadas;
 5.2 Somente serao aceitas as inscricoes realizadas conforme descrito no item 4.1, observando 
as orientacoes disponibilizadas no Grupo 2o INOVASUS-DF.
 5.3 A iniciativa devera ser escrita de forma resumida, utilizando arquivo do Microsoft Word, 
fonte Arial ou Times New Roman de tamanho 12, espaco simples, com no maximo 10.000 
caracteres, nao deve conter graficos e figuras e devera conter: 
 a) Titulo (ate 100 caracteres);
 b) Introducao (contextualizacao e justificativa);
 c) Caracteristicas do processo adotado ou imaginado (atores envolvidos, abrangencia, descricao 
do processo e metodos utilizados);
 d) Acoes desenvolvidas;
 e) Potencial da iniciativa;
 f) Carater multiplicador (acoes que poderao garantir ou permitir a continuidade/ampliacao 
da iniciativa);
 g) Resultados e conclusoes. 
 5.4 Ilustracoes, graficos, tabelas e referencias bibliograficas, deverao ser anexadas em 
arquivo proprio.
 5.5 O edital, o formulario de inscricao e outras informacoes sobre a selecao estarao dispo-
niveis no Grupo 2o INOVASUS-DF;
 5.6 Nao ha limite para o numero de propostas inscritas por Unidade da SES-DF; 
 5.7 Nao havera cobranca de taxa de inscricao e sera indeferida a inscricao do proponente que 
encaminhe a documentacao fora do prazo ou dos padroes estabelecidos neste edital.
 6. AVALIACAO E CLASSIFICACAO DAS INICIATIVAS 
 6.1 O Concurso premiara trabalhos que serao avaliados com base nos criterios abaixo:
a) Inovacao: demonstrar elementos novos na formulacao da iniciativa - Peso 3 (tres); entende-se 
por iniciativa inovadora aquela que introduzir novos processos, produtos, praticas, programas, 
politicas ou que melhoraram processos ja existentes, desenvolvidos para atender situacoes reais 
e se destinem a trazer beneficios significativos para a Gestao do Trabalho em Saude no SUS;
b) Multiplicacao: apresentar elementos conceituais, estrategicos ou metodologicos que possam 
ser adaptados a outros contextos - Peso 2 (dois); entende-se por carater multiplicador aquele 
cuja experiencia possa ser reproduzida por outras instancias e instituicoes; 
c) Resultado: demonstrar os resultados das acoes implementadas - Peso 2 (dois); entende-se 
por resultados na Gestao do Trabalho em Saude a comprovacao da efetividade das acoes 
implementadas; 
d) Atencao Basica: demonstrar acoes de gestao inovadoras na Atencao Basica no SUS - 
Peso 2 (dois); e 
e) Humanizacao: demonstrar dimensoes de humanizacao das relacoes de trabalho no SUS - 
Peso 1 (um).
6.1.1 Promocao da Igualdade: para os trabalhos que demonstrarem a incorporacao das dimen-
soes de genero, raca e acessibilidade, serao acrescidos 3 (tres) pontos em sua pontuacao final.
6.2. As iniciativas serao classificadas por meio de pontuacao - na escala de 0 a 5 - para cada um 
dos criterios apresentados, multiplicando-se esta pontuacao pelo Peso respectivo (ver criterios 
item 6.1), totalizando 50 (cinquenta) pontos, podendo ser acrescido em mais 3 (tres) pontos, 
caso o trabalho atenda ao item 6.1.1.
7. DAS ETAPAS DA AVALIACAO
 1a ETAPA  Verificacao dos requisitos para inscricao, estabelecidos neste edital;
 2a ETAPA  Pre-selecao de 20 iniciativas, das quais poderao ser solicitadas informacoes adi-
cionais, que deverao ser complementadas e compartilhadas com o perfil 2o INOVASUS-DF, 
arquivo do Microsoft Word, com o maximo de 20 (vinte) paginas, fonte Times New Roman, 
tamanho 12 e devera conter: 
 Titulo; 
 Introducao (contextualizacao e justificativa); 
 Apresentacao da iniciativa, contemplando: 
 a) Caracteristicas do processo adotado (sujeitos envolvidos, abrangencia, descricao do processo 
e metodos utilizados); 
 b) Potencial da iniciativa;
 c) Carater multiplicador (acoes que poderao garantir ou permitir a continuidade/ampliacao da 
pratica e dificuldades encontradas); 
 d) Resultados; 
 e) Conclusoes 
 f) Ilustracoes, graficos e tabelas; 
 g) Referencias bibliograficas. 
 3a ETAPA  Selecao e classificacao de 10 experiencias inovadoras.

